void UT_ClearDefaultReturnValue(UT_EntryKey_t FuncKey)
{
    UT_StubTableEntry_t *StubPtr;
    FILE *log = fopen("/tmp/logs/618.txt", "a");

    if (log != NULL)
    {
        fprintf(log, "[UT_ClearDefaultReturnValue] Entered\n");
    }

    StubPtr = UT_GetStubEntry(FuncKey, UT_ENTRYTYPE_RETVAL_CONFIG_CONSTANT);

    if (log != NULL)
    {
        fprintf(log, "[UT_ClearDefaultReturnValue] UT_GetStubEntry returned StubPtr=%p\n", (void *)StubPtr);
    }

    if (StubPtr != NULL)
    {
        if (log != NULL)
        {
            fprintf(log, "[UT_ClearDefaultReturnValue] StubPtr != NULL -> calling UT_ClearStubEntry(StubPtr)\n");
        }
        UT_ClearStubEntry(StubPtr);
    }
    else
    {
        if (log != NULL)
        {
            fprintf(log, "[UT_ClearDefaultReturnValue] StubPtr == NULL -> nothing to clear\n");
        }
    }

    if (log != NULL)
    {
        fclose(log);
    }
}
